- input: TEXT,F3XN,,"Please note that this report includes a partial refund of a contribution
    that was received in the fourth quarter of 2003 and reported on the committee's
    2003 Year-End Report.  The contributor (Stern Investment Management LLC) was determined
    to be excessive.  The excessive portion of the contributor's contribution is reported
    as refunded in the current reporting period.  Also note that New Jersey First
    is a small committee that has few administrative expenses.  The committee currently
    has no paid staff or rented office space.  The committee relies on consultants
    and volunteers to administer its activities.  All expenses incurred to operate
    the committee are reported as federal operating expenditures on the committee's
    FEC reports.  In addition to providing clarification information regarding the
    transactions contained in this filing, it is the intention of the committee for
    this information to address questions raised by the FEC in its RFAI related to
    the committee's 2003 Year-End Report."
